import { Injectable } from '@angular/core';

@Injectable({
  providedIn: 'root'
})
export class DisplayService {

  constructor() { }
  displayedArray:string="";
  arrayToDisplay:any;
  displayArr(arr:any){
    this.arrayToDisplay=arr;
    return `<div *ngFor="let elem of {$arrayToDisplay">{{elem|json}}</div>`;
  }
}
